import React from 'react';

function ImagePopup(props) {
    return (
        <div className="popup popup_with_image">
            <section className="popup__container">
                <button className="popup__close-button" type="button"/>
                <img className="popup__image" src={(props.card === null) ? "#" : props.card.link} alt="Фото места"/>
                <p className="popup__image-description">{(props.card === null) ? "#" : props.card.link}</p>
            </section>
        </div>
    );
}

export default ImagePopup;
